INSERT INTO `mdl_assign` (`id`, `course`, `name`, `intro`, `introformat`, `alwaysshowdescription`, `nosubmissions`, `submissiondrafts`, `sendnotifications`, `sendlatenotifications`, `duedate`, `allowsubmissionsfromdate`, `grade`, `timemodified`, `requiresubmissionstatement`, `completionsubmit`, `cutoffdate`, `gradingduedate`, `teamsubmission`, `requireallteammemberssubmit`, `teamsubmissiongroupingid`, `blindmarking`, `hidegrader`, `revealidentities`, `attemptreopenmethod`, `maxattempts`, `markingworkflow`, `markingallocation`, `sendstudentnotifications`, `preventsubmissionnotingroup`, `activity`, `activityformat`, `timelimit`, `submissionattachments`) VALUES
(1, 2, 'Sintak 2', '<p>Desain perencanaan proyek adalah proses pembuatan langkah-langkah yang diperlukan untuk menciptakan suatu produk. Buatlah desain perencanaan proyek yang rinci agar mudah diimplementasikan nantinya!</p>', 1, 1, 0, 1, 1, 0, 1713891600, 1713286800, 100, 1714543114, 0, 1, 0, 1714496400, 0, 0, 0, 0, 0, 0, 'none', -1, 0, 0, 1, 0, '<ol>\r\n<li>Buat desain perencanaan proyek berisi langkah-langkah kegiatan yang akan kelompokmu lakukan untuk menyelesaikan proyekmu dalam bentuk word.</li>\r\n<li>Upload file desain perencanaan proyek pada halaman berikut!</li>\r\n</ol>', 1, 0, 0),
(2, 2, 'Sintak 3', '<p>Susunan jadwal merupakan file yang berisi jadwal pengerjaan proyekmu. Buatlah timeline dari setiap kegiatan yang akan kamu kerjakan!</p>', 1, 1, 0, 1, 0, 0, 1715101200, 1714496400, 100, 1714543136, 0, 1, 0, 1715706000, 0, 0, 0, 0, 0, 0, 'none', -1, 0, 0, 1, 0, '<ol>\r\n<li>Buat susunan jadwal pengerjaan proyek yang akan kamu kerjakan dalam bentuk word</li>\r\n<li>Upload pada halaman ini!</li>\r\n</ol>', 1, 0, 0),
(3, 2, 'Sintak 5', '<p>Hasil proyek merupakan file yang berisi hasil akhir dari proyek yang telah kamu kerjakan. Buatlah hasil proyek dalam bentuk laporan akhir.</p>', 1, 1, 0, 1, 0, 0, 1715101200, 1714496400, 100, 1714543157, 0, 1, 0, 1715706000, 0, 0, 0, 0, 0, 0, 'none', -1, 0, 0, 1, 0, '<ol>\r\n<li>Buat laporan hasil akhir pengerjaan proyekmu dalam bentuk word.</li>\r\n<li>Masukkan setiap langkah-langkah yang kamu kerjakan secara terperinci beserta dokumentasinya.</li>\r\n<li>Upload hasil proyekmu dalam halaman ini!</li>\r\n</ol>', 1, 0, 0);
