(1, 'Sintak 2 jatuh tempo', '<p>Desain perencanaan proyek adalah proses pembuatan langkah-langkah yang diperlukan untuk menciptakan suatu produk. Buatlah desain perencanaan proyek yang rinci agar mudah diimplementasikan nantinya!</p>', 1, 0, 2, 0, 0, 0, NULL, 'assign', 1, 1, 'due', 1713891600, 0, 1713891600, 1, '', 1, 1714543114, NULL, NULL, NULL),
(2, 'Sintak 2 dinilai jatuh tempo', '<p>Desain perencanaan proyek adalah proses pembuatan langkah-langkah yang diperlukan untuk menciptakan suatu produk. Buatlah desain perencanaan proyek yang rinci agar mudah diimplementasikan nantinya!</p>', 1, 0, 2, 0, 0, 0, NULL, 'assign', 1, 1, 'gradingdue', 1714496400, 0, 1714496400, 1, '', 1, 1714543114, NULL, NULL, NULL),
(3, 'Sintak 3 jatuh tempo', '<p>Susunan jadwal merupakan file yang berisi jadwal pengerjaan proyekmu. Buatlah timeline dari setiap kegiatan yang akan kamu kerjakan!</p>', 1, 0, 2, 0, 0, 0, NULL, 'assign', 2, 1, 'due', 1715101200, 0, 1715101200, 1, '', 1, 1714543136, NULL, NULL, NULL),
(4, 'Sintak 3 dinilai jatuh tempo', '<p>Susunan jadwal merupakan file yang berisi jadwal pengerjaan proyekmu. Buatlah timeline dari setiap kegiatan yang akan kamu kerjakan!</p>', 1, 0, 2, 0, 0, 0, NULL, 'assign', 2, 1, 'gradingdue', 1715706000, 0, 1715706000, 1, '', 1, 1714543136, NULL, NULL, NULL),
(5, 'Sintak 5 jatuh tempo', '<p>Hasil proyek merupakan file yang berisi hasil akhir dari proyek yang telah kamu kerjakan. Buatlah hasil proyek dalam bentuk laporan akhir.</p>', 1, 0, 2, 0, 0, 0, NULL, 'assign', 3, 1, 'due', 1715101200, 0, 1715101200, 1, '', 1, 1714543157, NULL, NULL, NULL),
(6, 'Sintak 5 dinilai jatuh tempo', '<p>Hasil proyek merupakan file yang berisi hasil akhir dari proyek yang telah kamu kerjakan. Buatlah hasil proyek dalam bentuk laporan akhir.</p>', 1, 0, 2, 0, 0, 0, NULL, 'assign', 3, 1, 'gradingdue', 1715706000, 0, 1715706000, 1, '', 1, 1714543157, NULL, NULL, NULL);
