INSERT INTO `mdl_label` (`id`, `course`, `name`, `intro`, `introformat`, `timemodified`) VALUES
(1, 2, 'Materi Pointing Jaringan Nirkabel', '<p>Pada pembelajaran kali ini kita akan belajar materi Pointing. Adapun tujuan dari materi ini adalah sebagai berikut:</p>\r\n<ol>\r\n<li>Mengidentifikasi kebutuhan peralatan pada proses Pointing.</li>\r\n<li>Mengidentifikasi tahap-tahap dari Pointing.</li>\r\n<li><span style=\"color: black; font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: -18pt; text-align: initial;\">Mengoperasikan software untuk Pointing.</span></li>\r\n<li><span style=\"color: black; font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: -18pt; text-align: initial;\">Melaksanakan Pointing dengan benar.</span></li>\r\n<li><span style=\"color: black; font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: -18pt; text-align: initial;\">Memilih jenis antena dengan benar.</span></li>\r\n</ol>', 1, 1714544506);
